var Population=function(a,b){this.members=[];this.goal=a;for(this.generationNumber=0;b--;){var c=new Gene([]);c.random();this.members.push(c)}};Population.prototype.display=function(){console.log("<h2>Generation: "+this.generationNumber+"</h2>");console.log("<ul>");for(var a=0;a<this.members.length;a++)for(var b=0;b<this.members[a].code.length;b++)console.log("<li>"+this.members[a].code[b].action+" ("+this.members[a].cost+")("+this.members[a].code.length+")");console.log("</ul>")};
Population.prototype.sort=function(){this.members.sort(function(a,b){return a.cost-b.cost})};Population.prototype.generation=function(){for(var a=0;a<this.members.length;a++)console.log(this.members[a].code);this.members[0].calcCost()};
